	void setmap(){
		for(boomcount = 1 ; boomcount <= boom_number ; boomcount++){ //Set Boom
			row=HAL_RNG_GetRandomNumber(&hrng) % 8 + 1 ;
			collum=HAL_RNG_GetRandomNumber(&hrng) % 15 + 1 ;
			if(map[row][collum]!=9)
				map[row][collum]=9;
			else
				boomcount--;
		}
		for(row = 1 ; row <= 8 ; row++){ //Set Boom number count
			for(collum =1 ; collum <= 15 ;collum++){
				if(map[row][collum] != 9){
					if(map[row-1][collum-1] == 9) count++;
					if(map[row-1][collum] == 9) count++;
					if(map[row-1][collum+1] == 9) count++;
					if(map[row][collum-1] == 9) count++;
					if(map[row][collum+1] == 9) count++;
					if(map[row+1][collum-1] == 9) count++;
					if(map[row+1][collum] == 9) count++;
					if(map[row+1][collum+1] == 9) count++;
					map[row][collum] = count;
					count=0;
				}
			}
		}
		first=1;
	}

